select 	TRIM(CT.SIMD)||'_'||TRIM(C.TDOBNM) TABLE_NAME, 
		TRIM(C.TDSQLC) COL_NAME,
		SUBSTR(trim(COALESCE(LNGSPEC.FRDSCR,LNGDEF.FRDSCR)),1,35) COL_HEADING,
		trim(COALESCE(LNGSPEC.FRDSCR,LNGDEF.FRDSCR)) COL_DESC,
		TDPSEQ POS,
      DB2AS400_COLUMNS.DT_DRIVER DT_DRIVER,
      DB2AS400_COLUMNS.LONGC LONGC,
      DB2AS400_COLUMNS.SCALEC SCALEC,
      DB2AS400_COLUMNS.COL_MANDATORY COL_MANDATORY
from <%=odiRef.getOption("JDE_CENTRAL_OBJECTS")%>.F98711 C 
left outer join <%=odiRef.getOption("JDE_DATA_DICTIONARY")%>.F9202 LNGDEF   on (c.tdobnd=LNGDEF.frdtai and  LNGDEF.FRLNGP =' ' and LNGDEF.FRSYR = ' ') 
left outer join <%=odiRef.getOption("JDE_DATA_DICTIONARY")%>.F9202  LNGSPEC  on (c.tdobnd=LNGSPEC.frdtai and  LNGSPEC.FRLNGP ='<%=odiRef.getOption("JDE_LANGUAGE")%>' and LNGSPEC.FRSYR = ' ' ) 
INNER JOIN 	<%=odiRef.getOption("JDE_OBJECT_LIBRARIAN")%>.F9860 CT ON ( CT.SIOBNM=C.TDOBNM AND  CT.SIFUNO='TBLE'  <% 
if ((odiRef.getOption("JDE_MODULES").length()>0)) 
{ 
	if ((odiRef.getOption("JDE_MODULES").indexOf(",")>0))
	{ 
	out.print( "	 and TRIM(SISY) in ("+odiRef.getOption("JDE_MODULES")+")" ); 
	}
	else
	{
		out.print( "	 and TRIM(SISY) like '"+odiRef.getOption("JDE_MODULES")+"'" ); 
	};
};
%>  ) 
INNER JOIN (select	col.DBILFI	TABLE_NAME,
		col.DBILFL	COL_NAME,
		case Strip(col.DBITYP) 
		        when 	'TIMESTMP' 
		        then 	'TIMESTAMP' 
		        else 	Strip(col.DBITYP) 
	                           end                    DT_DRIVER,
		col.DBIFLN         LONGC,
		col.DBINSC	SCALEC,
		case col.DBINUL
		      when 	'Y' then  '0'
		      else	 '1'
	                           end COL_MANDATORY
		from	QSYS.QADBIFLD	col
		Where	col.DBILIB  ='<%=odiRef.getModel("SCHEMA_NAME")%>'
		) DB2AS400_COLUMNS ON (trim(C.TDOBNM) = DB2AS400_COLUMNS.TABLE_NAME and  trim(C.TDSQLC) = DB2AS400_COLUMNS.COL_NAME )
where trim(C.TDOBNM)  like '<%=odiRef.getModel("REV_OBJ_PATT")%>' 
and C.TDOBNM  like '%Z%'

select  distinct
	TRIM(SISY) SMOD_CODE,
  	COALESCE(LIBELLE,TRIM(SISY))  SMOD_NAME
FROM <%=odiRef.getOption("JDE_OBJECT_LIBRARIAN")%>.F9860
inner join QSYS.QADBXREF on (DBXLIB ='<%=odiRef.getModel("SCHEMA_NAME")%>'  and TRIM(SIOBNM) = DBXLFI)
left outer join (select F0005.DRKY SYSCODE,F0005.DRKY||' - '||COALESCE(F0005D.DRDL01,F0005.DRDL01) LIBELLE ,F0005.DRDL01
	from <%=odiRef.getOption("JDE_CONTROL_TABLES")%>.F0005 F0005
	left outer join <%=odiRef.getOption("JDE_CONTROL_TABLES")%>.F0005D  F0005D on (TRIM(F0005D.DRRT) = 'SY' and trim(F0005D.DRSY) = 'H90' and TRIM(DRLNGP) = '<%=odiRef.getOption("JDE_LANGUAGE")%>'  and F0005.DRKY = F0005D.DRKY)
	where TRIM(F0005.DRRT) = 'SY' and trim(F0005.DRSY) = 'H90' ) LIB on ( trim(SYSCODE) = trim(SISY) )
where 
	TRIM(SIOBNM) like '<%=odiRef.getModel("REV_OBJ_PATT")%>' 
	and SIFUNO='TBLE'	
<% 
if ((odiRef.getOption("JDE_MODULES").length()>0)) 
{ 
	if ((odiRef.getOption("JDE_MODULES").indexOf(",")>0))
	{ 
	out.print( " and TRIM(SISY) in ("+odiRef.getOption("JDE_MODULES")+")" ); 
	}
	else
	{
		out.print( " and TRIM(SISY) like '"+odiRef.getOption("JDE_MODULES")+"'" ); 
	};
};
%>

